import { ListeProfesseurs } from '../professeurs/ListeProfesseurs';
import { professeurs } from '../professeurs/Professeurs';

function handleSubmit(e) {
    // Prevent the browser from reloading the page
    e.preventDefault();

    // Read the form data
    const form = e.target;
    const formData = new FormData(form);

    // You can pass formData as a fetch body directly:
    fetch('/some-api', { method: form.method, body: formData });

    // Or you can work with it as a plain object:
    const formJson = Object.fromEntries(formData.entries());
    console.log(formJson);
  }

export default function Professeurs() {
    return (
        <div>    
            {/* <ListeProfesseurs liste={professeurs}/> */}
            <form method='POST' onSubmit={handleSubmit}>
                <label><input type="radio" name="myRadio" value="option1" defaultChecked={true} /> Option 1</label>
                <label><input type="radio" name="myRadio" value="option2" /> Option 2</label>
                <label><input type="radio" name="myRadio" value="option3" /> Option 3</label>
                <button type="submit">Submit form</button>
            </form>
        </div>
    )
}
